import style from 'styled-components'

export const Container = style.div`
    display: flex;
    align-items: center;
    justify-content: space-around;
    flex-wrap:wrap;
    height: 100vh;
    width:80%;
    margin:auto;
`;

export const Div = style.div`
    width:450px;
    background:red;


`
